import Head from 'next/head';
import { useEffect } from 'react';
import { XIcon } from '@heroicons/react/outline';
import Header from '../components/Header';
import Navbar from '../components/Navbar';
import Map from '../components/Map';
import styles from '../styles/Home.module.css';

const DEFAULT_CENTER = [3.315834, 101.559201];

export default function Home() {
	function toggleModal() {
		const body = document.querySelector('body');
		const modal = document.querySelector('.modal');
		modal.classList.toggle('opacity-0');
		modal.classList.toggle('pointer-events-none');
		body.classList.toggle('modal-active');
	}

	useEffect(() => {
		// var openmodal = document.querySelectorAll('.modal-open');
		// for (var i = 0; i < openmodal.length; i++) {
		// 	openmodal[i].addEventListener('click', function (event) {
		// 		event.preventDefault();
		// 		toggleModal();
		// 	});
		// }
		// const overlay = document.querySelector('.modal-overlay');
		// overlay.addEventListener('click', toggleModal);
		// var closemodal = document.querySelectorAll('.modal-close');
		// for (var i = 0; i < closemodal.length; i++) {
		// 	closemodal[i].addEventListener('click', toggleModal);
		// }
		// document.onkeydown = function (evt) {
		// 	evt = evt || window.event;
		// 	var isEscape = false;
		// 	if ('key' in evt) {
		// 		isEscape = evt.key === 'Escape' || evt.key === 'Esc';
		// 	} else {
		// 		isEscape = evt.keyCode === 27;
		// 	}
		// 	if (isEscape && document.body.classList.contains('modal-active')) {
		// 		toggleModal();
		// 	}
		// };
		// function toggleModal() {
		// 	const body = document.querySelector('body');
		// 	const modal = document.querySelector('.modal');
		// 	modal.classList.toggle('opacity-0');
		// 	modal.classList.toggle('pointer-events-none');
		// 	body.classList.toggle('modal-active');
		// }
	});

	return (
		<div>
			<Head>
				<title>MyPutih</title>
			</Head>

			<main>
				<Header />
				<Navbar />
				<button
					onClick={toggleModal}
					className="modal-open bg-transparent border border-gray-500 hover:border-indigo-500 text-gray-500 hover:text-indigo-500 font-bold py-2 px-4 rounded-full">
					Open Modal
				</button>

				<div className="modal z-50 opacity-0 pointer-events-none fixed w-full h-full top-0 left-0 flex items-center justify-center">
					<div
						onClick={toggleModal}
						className="modal-overlay absolute w-full h-full bg-gray-900 opacity-50"></div>
					<div className="modal-container bg-white md:max-w-md mx-auto rounded shadow-lg z-50 overflow-y-auto w-full max-w-xs">
						<form class="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4">
							<div class="mb-4">
								<label
									class="block text-gray-700 text-sm font-bold mb-2"
									for="username">
									Username
								</label>
								<input
									class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
									id="username"
									type="text"
									placeholder="Username"
								/>
							</div>
							<div class="mb-6">
								<label
									class="block text-gray-700 text-sm font-bold mb-2"
									for="password">
									Password
								</label>
								<input
									class="shadow appearance-none border border-red-500 rounded w-full py-2 px-3 text-gray-700 mb-3 leading-tight focus:outline-none focus:shadow-outline"
									id="password"
									type="password"
									placeholder="******************"
								/>
								<p class="text-red-500 text-xs italic">
									Please choose a password.
								</p>
							</div>
							<div class="flex items-center justify-between">
								<button
									class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
									type="button">
									Sign In
								</button>
								<a
									class="inline-block align-baseline font-bold text-sm text-blue-500 hover:text-blue-800"
									href="#">
									Forgot Password?
								</a>
							</div>
						</form>
					</div>
				</div>

				<Map className={styles.homeMap} center={DEFAULT_CENTER} zoom={14}>
					{({ TileLayer, Marker, Popup }) => (
						<>
							<TileLayer
								url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
								attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
							/>
							<Marker position={DEFAULT_CENTER}>
								<Popup>
									A pretty CSS3 popup. <br /> Easily customizable.
								</Popup>
							</Marker>
						</>
					)}
				</Map>
			</main>
		</div>
	);
}
